import re
import base64
from PIL import Image
from io import BytesIO
images = {}
raw_images = {
    'logo': 'data:image/jpeg;base64,',
    '💻': 'data:image/png;base64,',
    '🏙': 'data:image/png;base64,',
    '🏅': 'data:image/png;base64,',
    '🎓': 'data:image/png;base64,',
    '💸': 'data:image/png;base64,',
    '📔': 'data:image/png;base64,',
    '🚇': 'data:image/png;base64,',
    '💼': 'data:image/png;base64,',
    '➡': 'data:image/png;base64,',
    '🔋': 'data:image/png;base64,'
}
emojis_pattern = f"([{''.join(['' if key in ['logo', '➡'] else key for key in raw_images])}])"
for key, value in raw_images.items():
    images[key] = Image.open(BytesIO(base64.b64decode(re.sub('^data:image/.+;base64,', '', value))))
